import React, { useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'


const App = () => {
  const [num, setNum] = useState(0)
  return (
    <>
      <button onClick={(()=>{
        return setNum(num+1)
      })}
      
      >Click me {num} </button>
    </>
  )
}
export default App;
